import {View,Text,Image,StyleSheet} from "react-native"

const Company=(props)=>{
    const companyData=props.companyData
    return <View>
        <Image style={styles.companyImage} source={require("../assets/company1.jpg")}/>
        <Text style={styles.companyTitle}>Google</Text>
        <Text>Google LLC is an American multinational
             technology company focusing on artificial intelligence, 
             online advertising, search engine technology, cloud computing,
              computer software, quantum computing, e-commerce, 
              and consumer electronics.</Text>
    </View>
}

const styles=StyleSheet.create({
    companyImage:{
        width:300,
        height:300
    },
    companyTitle:{
        fontSize:30,
        fontWeight:"bold"
    }
})

export default Company
